import React from 'react';
import { Container, Row, Col, Card, Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import SidebarApp from './GeneralInfoSidebar';
import './HomePage.css';

const HomePage = ({ currentUser }) => {
  return (
    <div>
      <header className="bg-warning text-center py-4">
        <h1>Salvando Vidas Desde 1997</h1>
        {currentUser ? (
          <div>
            <p>Bienvenido, {currentUser.username}</p>
            <Button variant="secondary" onClick={() => window.location.reload()}>Cerrar Sesión</Button>
          </div>
        ) : (
          <p>
            <Link to="/login">Iniciar Sesión</Link> | <Link to="/register">Registrarse</Link>
          </p>
        )}
      </header>
      <Container fluid>
        <Row>
          <Col md={3}>
            <SidebarApp />
          </Col>
          <Col md={6}>
            <AnimalList />
          </Col>
          <Col md={3}>
            <div className="mb-4">
              <h5>Ayúdanos</h5>
              <Button as={Link} to="/register" variant="primary" block>
                Adopta o acoge
              </Button>
              <Button as={Link} to="/register" variant="primary" block>
                Hazte socio o padrino
              </Button>
              <Button as={Link} to="/register" variant="primary" block>
                Hazte voluntario
              </Button>
              <Button as={Link} to="/register" variant="primary" block>
                Difunde
              </Button>
            </div>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

const AnimalList = () => (
  <div>
    <h2>Listado de animales</h2>
    <Row>
      {animals.map((animal, index) => (
        <Col key={index} sm={12} md={6} lg={4} className="mb-4">
          <Card className="h-100">
            <Card.Img variant="top" src={animal.photo} />
            <Card.Body>
              <Card.Title>{animal.name}</Card.Title>
              <Card.Text>
                <strong>Género:</strong> {animal.gender}<br />
                <strong>Edad:</strong> {calculateAge(animal.birthDate)}<br />
                <strong>Status:</strong> {animal.status}
              </Card.Text>
              <Button variant="primary">Ver más</Button>
            </Card.Body>
          </Card>
        </Col>
      ))}
    </Row>
  </div>
);

const animals = [
  { name: 'Aqua', gender: 'Hembra', birthDate: '2021-01-15', status: 'En adopción', photo: 'path/to/photo1.jpg' },
  { name: 'Aries', gender: 'Macho', birthDate: '2020-05-10', status: 'En adopción', photo: 'path/to/photo2.jpg' },
  { name: 'Baileys', gender: 'Hembra', birthDate: '2019-03-22', status: 'En adopción', photo: 'path/to/photo3.jpg' },
  // Agrega más animales según sea necesario
];

const calculateAge = (birthDate) => {
  const birth = new Date(birthDate);
  const today = new Date();
  const diff = today - birth;
  const ageInDays = Math.floor(diff / (1000 * 60 * 60 * 24));

  if (ageInDays < 30) {
    return `${ageInDays} días`;
  } else if (ageInDays < 365) {
    return `${Math.floor(ageInDays / 30)} meses`;
  } else {
    return `${Math.floor(ageInDays / 365)} años`;
  }
};

export default HomePage;
